function commentsGistCtrl($scope, $routeParams, ghAPI) {
    
    if ($scope.gist.comments > 0) {
        ghAPI.comments($routeParams.gistId, function (response) {
            if (response.status === 200) {
                $scope.comments = response.data;
            } else {
                
            }
        });
    }
}
'use strict';

function createGistCtrl($scope, $rootScope, ghAPI, gistData) {

    $scope.description = '';

    $scope.isPublic = false;
    $scope.files = [
        {
            filename: '',
            content: ''
        }
    ];

    $scope.addFile = function () {
        
        
        $scope.files.push({
            content: '',
            filename: '',
            language: 'html'
        });
    };

    $scope.deleteFile = function (index) {
        $scope.files.splice(index,1);
    };

    $scope.enableEdit = function () {
        $rootScope.edit = true;
        $('.edit').slideDown('slow');
    };
    $scope.disableEdit = function () {
        $rootScope.edit = false;
        $('.edit').slideUp('slow');
    };

    $scope.dragStart = function (e) {
        e.stopPropagation();
        e.preventDefault();
        $('.edit').slideDown('slow');
        $('.main section').addClass('dragarea');
        $('.edit span').text('Drag detected - now drop!');
        
    };

    $scope.drop = function (e) {
        e.stopPropagation();
        e.preventDefault();
        var data = event.dataTransfer;
        for (var i = 0; i < data.files.length; i++) { // For each dropped file
            var file = data.files[i];
            var reader = new FileReader();

            $('.edit').slideUp('slow');
            $('.ok').slideDown('slow');
            $('.main section').removeClass('dragarea');
            $('.ok span').html('Dropped: <b>' + file.name + '</b>');
            $rootScope.edit = true;
            reader.onloadend = (function (filename) {
                return function (event) {
                    $scope.files.push({
                        filename: filename,
                        content: event.target.result,
                        language: 'html'
                    });
                    $scope.$digest();
                };
            })(file.name);

            reader.readAsText(file);

        }
    };

    $scope.dragEnd = function (e) {
        e.stopPropagation();
        e.preventDefault();
        
    };

    $scope.save = function ($event) {

        if ($event) {
            $event.preventDefault();
        }

        var data = {
            description: $scope.description,
            "public": $scope.isPublic,
            files: {}
        };

        for (var file in $scope.files) {
            data.files[$scope.files[file].filename] = {
                content: $scope.files[file].content
            };
        }

        ghAPI.create(data, function (response) {
            if (response.status === 201) {

                var newGist = {
                    id: response.data.id,
                    description: $scope.description,
                    "public": $scope.isPublic,
                    files: {}
                };
                $rootScope.edit = false;
                $('.ok').slideDown('slow');
                $('.ok span').text('Gist saved');
                newGist.tags = $scope.description ? $scope.description.match(/(#[A-Za-z0-9\-\_]+)/g) : [];
                gistData.list.unshift(newGist);

                window.location.href = "#/gist/" + response.data.id;
            }
        });
    };
}
'use strict';

function headerController($scope, notificationService, $location, appSettings, gistData, onlineStatus) {

    notificationService.login();

    notificationService.forward('receiveNotification', $scope);
    notificationService.forward('notificationRead', $scope);
    notificationService.forward('identify', $scope);
    notificationService.forward('disconnect', $scope);

    $scope.avatar = 'https://secure.gravatar.com/avatar/' + JSON.parse(localStorage.settings).avatar;
    $scope.notifications = notificationService.notifications;

    $scope.logOut = function () {

        
        notificationService.logout();

        gistData.list = [];
        appSettings.logOut();
    };

    $scope.onlineStatus = onlineStatus;

    $scope.$watch('onlineStatus.isOnline()', function(online) {
       if (online && (!window.ioSocket.socket.connected || !window.ioSocket.socket.reconnecting) ) {
           notificationService.login();
       } else if (!online) {
           notificationService.disconnected();
       }
    });

    $scope.$on('socket:disconnect', function(e) {
       
        notificationService.disconnected();
    });

    $scope.$on('socket:identify', function(e, data) {
        // identify to the server
        
        notificationService.register();

    });

    $scope.$on('socket:receiveNotification', function(e, data) {
        
        notificationService.add({
            sender: data.sender,
            name: data.name,
            gistId: data.gistId,
            gravatar_id: data.gravatar_id
        });
        
    });

    $scope.$on('socket:notificationRead', function(e, data) {
        // remove read notification
        
        (data && data.gistId) && notificationService.remove(data.gistId);
    });

    $scope.loadExternalGist = function(id, user) {
        $location.url('/shared/' + user + '/' + id);
    };

    $scope.reject = function(id) {
        
        notificationService.remove(id);
        notificationService.send('notificationRead', {gistId: id});
    };

}
'use strict';

function listGistCtrl($scope, ghAPI, gistData, notificationService) {
    $scope.gists = gistData.list;
    $scope.onlineStatus = {
       state: "Offline",
       status: false
    };

    $scope.$on('ApplicationState', function(e, data) {
        
        $scope.onlineStatus.state = data.online ? "Online" : "Offline";
        $scope.onlineStatus.status = data.online;

    }, true);

    // Get the gists list
    if ($scope.gists.hasOwnProperty('lastUpdated')) {
        
        var now = new Date();
        var seconds = Math.round((now.getTime() - $scope.gists.lastUpdated.getTime()) / 1000);
        
        if (seconds > 60) {
            ghAPI.gists();
        }
    } else {
        ghAPI.gists();
    }
}
'use strict';

function loginCtrl($scope, ghAPI, appSettings, notificationService) {
    $scope.submit = function () {
        $scope.spinner = true;
        ghAPI.login($scope.user, $scope.pass, function (response) {
            if (response.status === 201) {
                
                var data = {};
                data.token = response.data.token;
                ghAPI.setToken(response.data.token);
                data.theme = appSettings.get('default') || 'default';
                data.avatar = appSettings.get('none') || 'none';
                data.editor_theme = appSettings.get('tomorrow') || 'tomorrow';
                localStorage.settings = JSON.stringify(data);
                window.location.href = '#/';
            } else {
                $scope.spinner = false;
                
                $('.warn').slideDown('slow');
                $('.warn span').text('Log-in failed - server responded with error');
                setTimeout(function () {
                    $('.warn').slideUp();
                }, 2500);
            }
        });
    };
}
'use strict';

function mainCtrl($scope, $http, appSettings) {
    $scope.latestVersion = appSettings.get('latestVersion');
    $scope.currentVersion = '';
    $scope.updateAvailable = false;

    $scope.gotoSite = function () {
        gui.Shell.openExternal('http://www.gistoapp.com');
    };

    // get the current version number
    $http.get('./package.json').success(function (data) {
        $scope.currentVersion = data.version;
    });

    var timestamp = new Date().getTime() - 86400000; // 1 day ago
    if (!$scope.latestVersion || $scope.latestVersion.timestamp < timestamp) {
        
        // get the latest version number
        $http({
            url: 'https://api.github.com/repos/Gisto/Gisto/contents/app/package.json',
            headers: {
                Accept: "application/vnd.github.3.raw"
            },
            method: 'get'
        }).success(function (data) {
                appSettings.setOne('latestVersion', {version: data.version, timestamp: new Date().getTime() });
            });

    }

    $scope.$watch('currentVersion + latestVersion', function () {

        if ($scope.currentVersion && $scope.latestVersion && $scope.currentVersion !== $scope.latestVersion.version) {
            $scope.updateAvailable = true;
        }
    });
}
'use strict';

function settingsCtrl($scope, appSettings,$rootScope) {
    $scope.themes = appSettings.theme_list;
    $scope.editor_theme = appSettings.get('editor_theme') || 'tomorrow';
    $scope.editor_themes = appSettings.editor_theme_list;
    $scope.font_sizes = appSettings.font_size;
    $scope.font_size = appSettings.get('font_size') || '13';
    $scope.min_height = appSettings.get('min_height') || '';
    $scope.max_height = appSettings.get('max_height') || '';
    $scope.theme = appSettings.get('theme') || 'default';
    $scope.token = appSettings.get('token') || '';
    $scope.avatar = appSettings.get('avatar') || '';
    angular.element('.the-gist pre').css({
        'min-height': $scope.min_height + 'px',
        'max-height': $scope.max_height + 'px'
    });
    $scope.update_settings = function () {
        var data = {};
        data.theme = $scope.theme;
        data.editor_theme = $scope.editor_theme;
        data.font_size = $scope.font_size;
        data.min_height = $scope.min_height;
        data.max_height = $scope.max_height;
        data.token = appSettings.get('token');
        data.avatar = appSettings.get('avatar');
        var saved = appSettings.set(data, function (response) {
            if (response.status === 'ok') {
                
                window.location.reload();
            } else {
                
            }
        });

    };

    $rootScope.goToSite = function(url,params) {

        for(var i = 0, l = params.length; i < l; i++){
            var out = url.replace(/{(\d+)}/g,function(match, i) {
                return typeof params[i] != 'undefined' ? params[i] : match;
            });
        }
        
        gui.Shell.openExternal(out);
    };
}
'use strict';

function sharedCtrl($scope, ghAPI, gistData, $routeParams, $location, notificationService, $window) {

    $scope.author = $routeParams.user;

    $scope.gist = ghAPI.gist($routeParams.id);

    $scope.fork = function() {
        ghAPI.fork($routeParams.id).then(function(data) {
            notificationService.remove($routeParams.id);
            notificationService.send('notificationRead', {gistId: $routeParams.id});
            $location.url('/gist/' + data.id);
        });
    };

    $scope.reject = function() {
        notificationService.remove($routeParams.id);
        
        notificationService.send('notificationRead', {gistId: $routeParams.id});
        $window.history.back(-1);
    };

};
'use strict';

function singleGistCtrl($scope, $routeParams, gistData, ghAPI, $rootScope, notificationService, appSettings) {

    $scope.gist = gistData.getGistById($routeParams.gistId);

    if ($scope.gist.hasOwnProperty('single') && $scope.gist.single.hasOwnProperty('lastUpdated')) {
        
        var now = new Date();
        var seconds = Math.round((now.getTime() - $scope.gist.single.lastUpdated.getTime()) / 1000);
        
        if (seconds > 60) {
            ghAPI.gist($routeParams.gistId);
        }
    } else {
        ghAPI.gist($routeParams.gistId);
    }

    $scope.share = function() {
        if ($scope.userToShare) {
            notificationService.send('sendNotification', { recipient: $scope.userToShare, gistId: $scope.gist.id, name: $scope.gist.description, gravatar_id: appSettings.get('gravatar_id')});
            
        } else {
            $('.warn').slideDown('slow');
            $('.warn span').text('User is empty');
            setTimeout(function () {
                $('.warn').slideUp();
            }, 2500);
        }

    };

    $scope.copyToClipboard = function (data, message,type) {
        message = message || 'Content of a file <b>' + data.filename + '</b> copied to clipboard';
        if (clipboard !== undefined) {
            if(type === 'embed') {
                clipboard.set('<script src="' + data + '"></script>');
            } else {
                clipboard.set(data.content || data, 'text');
            }
        } else {
            // Copy to clipboard really only works in App
            
            
        }

        $('.ok').slideDown('slow');
        $('.ok span').html(message);
        setTimeout(function () {
            $('.ok').slideUp();
        }, 2500);
    };

    $scope.goToGist = function (user, id, file) {
        
        gui.Shell.openExternal('https://gist.github.com/' + user + '/' + id + '/#file-' + file.replace(/[.]/gi, '-'));
    };

    $scope.enableEdit = function (old_obj,old_description) {
        $scope.old_object = angular.copy(old_obj);
        $scope.old_description = old_description;

        $rootScope.edit = true;
        $('.edit').slideDown('slow');
    };
    $scope.disableEdit = function () {
        $rootScope.edit = false;
        $('.edit').slideUp('slow');
    };

    $scope.warnDeleteGist = function () {
        $('.delete').slideDown('slow');
    };
    $scope.cancelDeleteGist = function () {
        $('.delete').slideUp('slow');
    };

    $scope.$on('serverFailure', function() {
        
        $('.notification-error').slideDown('slow');

        setTimeout(function() {
            $('.notification-error').slideUp('slow');
        }, 3000);
    });

    $scope.star = function ($event) {
        if ($event) {
            $event.preventDefault();
        }
        ghAPI.star($scope.gist.single.id, function (response) {
            if (response.status === 204) {
                
                $('.ok').slideDown('slow');
                $('.ok span').text('Gist starred');
                $('.star').removeClass('icon-star-empty').addClass('icon-star');
                $scope.gist.single.starred = !$scope.gist.single.starred;
                $scope.gist.has_star = true;
                setTimeout(function () {
                    $('.ok').slideUp();
                }, 2500);
            } else {
                
                $('.warn').slideDown('slow');
                $('.warn span').text('Gist not starred, something went wrong');
                setTimeout(function () {
                    $('.warn').slideUp();
                }, 2500);
            }
        });
    };

    $scope.unstar = function ($event) {
        if ($event) {
            $event.preventDefault();
        }
        ghAPI.unstar($scope.gist.single.id, function (response) {
            if (response.status === 204) {
                
                $('.ok').slideDown('slow');
                $('.ok span').text('Star removed');
                $('.star').removeClass('icon-star').addClass('icon-star-empty');
                $scope.gist.single.starred = !$scope.gist.single.starred;
                $scope.gist.has_star = false;
                setTimeout(function () {
                    $('.ok').slideUp();
                }, 2500);
            } else {
                
                $('.warn').slideDown('slow');
                $('.warn span').text('Something went wrong');
                setTimeout(function () {
                    $('.warn').slideUp();
                }, 2500);
            }
        });
    };

    $scope.del = function ($event) {
        if ($event) {
            $event.preventDefault();
        }
        
        ghAPI.delete($scope.gist.single.id, function (response) {
            if (response.status === 204) {
                $('.ok').slideDown('slow');
                $('.ok span').text('Gist deleted');
                // Remove from list of gists.
                gistData.list.splice(gistData.list.indexOf(gistData.getGistById($scope.gist.single.id)), 1);
                setTimeout(function () {
                    $('.ok').slideUp();
                    window.location.href = 'index.html#/';
                }, 1000);
            } else {
                
                $('.warn').slideDown('slow');
                $('.warn span').text('Gist not deleted, something went wrong');
                setTimeout(function () {
                    $('.warn').slideUp();
                }, 2500);
            }
        });
    };

    $scope.addFile = function () {
        var fileName = 'newFile' + Object.keys($scope.gist.single.files).length + '.txt';
        $scope.gist.single.files[fileName] = {
            content: '',
            filename: fileName,
            language: 'text'
        };
        $scope.enableEdit();
    };

    $scope.dragStart = function (e) {
        e.stopPropagation();
        e.preventDefault();
        $('.edit').slideDown('slow');
        $('.main section').addClass('dragarea');
        $('.edit span').text('Drag detected - now drop!');
        
    };

    $scope.drop = function (e) {
        e.stopPropagation();
        e.preventDefault();
        var data = event.dataTransfer;
        for (var i = 0; i < data.files.length; i++) { // For each dropped file
            var file = data.files[i];
            var reader = new FileReader();

            $('.edit').slideUp('slow');
            $('.ok').slideDown('slow');
            $('.main section').removeClass('dragarea');
            $('.ok span').html('Dropped: <b>' + file.name + '</b>');
            $rootScope.edit = true;
            reader.onloadend = (function (filename) {
                return function (event) {
                    $scope.gist.single.files[filename] = {
                        filename: filename,
                        content: event.target.result,
                        language: 'html'
                    };
                    $scope.$digest();
                };
            })(file.name);

            reader.readAsText(file);

        }
    };

    $scope.dragEnd = function (e) {
        e.stopPropagation();
        e.preventDefault();
        
    };

    $scope.deleteFile = function (file_name) {
        
        $('.loading span').html('Deleting file <b>' + file_name + '</b>');

        var data = {
            description: $scope.gist.description,
            id: $scope.gist.id,
            files: {}
        };

        for (var file in $scope.gist.single.files) {
            data.files[file] = {
                content: $scope.gist.single.files[file].content,
                filename: $scope.gist.single.files[file].filename
            };
        }
        // Remove single file from gist array
        data.files[file_name] = null;
        delete $scope.gist.single.files[file_name];

        ghAPI.edit($scope.gist.single.id, data, function (response) {
            if (response.status === 200) {
                $('.ok').slideDown('slow');
                $('.ok span').html('File ' + file_name + ' removed');
                $rootScope.edit = false;
                //$scope.gist.single.files = response.data.files;
                $scope.gist.single.history = response.data.history;
                $scope.gist.filesCount = Object.keys($scope.gist.single.files).length;

                

                setTimeout(function () {
                    $('.ok').slideUp();
                }, 2500);
            } else {
                $('.warn').slideDown('slow');
                $('.warn span').text('Something went wrong');
                setTimeout(function () {
                    $('.warn').slideUp();
                }, 2500);
            }
        });

    };

    $scope.update = function () {
        $('.loading span').text('Saving...');
        $('.edit').slideUp();

        var data = {
            description: $scope.gist.description,
            id: $scope.gist.id,
            files: {}
        };

        for (var file in $scope.gist.single.files) {
            data.files[file] = {
                content: $scope.gist.single.files[file].content,
                filename: $scope.gist.single.files[file].filename
            };
        }

        if( angular.equals($scope.old_object, $scope.gist.single.files) && angular.equals($scope.old_description, $scope.gist.description) ) {
            $('.warn').slideDown('slow');
            $('.warn span').text('No changes to save.');
            $rootScope.edit = false;
            setTimeout(function () {
                $('.warn').slideUp();
            }, 2500);
        } else {
            ghAPI.edit($scope.gist.single.id, data, function (response) {
                if (response.status === 200) {
                    $('.ok').slideDown('slow');
                    $('.ok span').text('Gist saved');
                    $rootScope.edit = false;
                    $scope.gist.single.files = response.data.files;
                    $scope.gist.single.history = response.data.history;
                    $scope.gist.tags = $scope.gist.description ? $scope.gist.description.match(/(#[A-Za-z0-9\-\_]+)/g) : [];
                    $scope.gist.filesCount = Object.keys($scope.gist.single.files).length;

                    setTimeout(function () {
                        $('.ok').slideUp();
                    }, 2500);
                } else if (response.status === 422) { // ststus code of: 422 (Unprocessable Entity)
                    $('.warn').slideDown('slow');
                    $('.warn span').text('You cannot save empty files');
                    setTimeout(function () {
                        $('.warn').slideUp();
                    }, 2500);
                } else {
                    $('.warn').slideDown('slow');
                    $('.warn span').text('Something went wrong');
                    setTimeout(function () {
                        $('.warn').slideUp();
                    }, 2500);
                }
            });
        }
    };
}
